INSERT INTO `vehicles` (`id`, `views`, `vehicle_model_id`, `type_id`, `color_id`, `year_id`, `odometer`, `vin`, `engine_number`, `license_plate`, `bpkb_number`, `purchase_price`, `sale_price`, `status`, `description`, `dp_percentage`, `engine_specification`, `location`, `notes`, `created_at`, `updated_at`, `deleted_at`) VALUES
(2, 15, 2, 1, 1, 25, 23000, 'MH1KFA114RK241141', 'KFA1E1240996', 'D 2099 ZFR', 'V00285995', 19850000.00, 24900000.00, 'available', '<p><strong>Honda Vario 160 ABS - Tenaga dan Keamanan dalam Satu Paket.</strong></p><p>Tingkatkan pengalaman berkendara Anda dengan Honda Vario 160 ABS. Nikmati akselerasi bertenaga dari mesin 160cc eSP+ dan rasa percaya diri penuh berkat pengereman canggih ABS. Desainnya yang sporty dan fitur modern seperti Smart Key System menjadikan setiap perjalanan lebih istimewa. Unit dalam kondisi prima dan terawat, siap untuk Anda bawa pulang. Segera hubungi kami untuk penawaran terbaik!</p>', 20.00, '160', 'Majalaya', '<p>HONDA NEW VARIO 160 ABS 2024</p>', '2025-08-31 07:42:13', '2025-11-03 20:19:04', NULL),
(3, 16, 5, 1, 5, 25, 3000, 'MH3SEK610RJ140364', 'E34KE0140368', 'D 3546 ZFQ', 'U-07788158', 20000000.00, 25000000.00, 'available', '<p></p>', 20.00, 'MESIN MULUS', 'BANDUNG MAJALAYA', '<p></p>', '2025-09-10 03:33:58', '2025-11-06 18:12:23', NULL),
(5, 8, 24, 2, 10, 18, 55000, 'MH3RG4610HK031408', 'G3E7E0407459', 'D 2387 ABD', 'N-07994832', 8500000.00, 13500000.00, 'available', '<p>All New Vixion menjanjikan Durable Engine yang didukung mesin baru. Motor ini mengusung mesin 150cc LC4V yang bertenaga dan responsif. Keunggulan utama dari mesin baru All New Vixion adalah fitur assist &amp; slipper clutch. Fitur assist membuat pengoperasian kopling menjadi lebih ringan, sedangkan slipper clutch membuat perpindahan gigi lebih halus sehingga akselerasi semakin cepat. Mesin All New Vixion berteknologi DiASil Cylinder dan Forged Piston yang membuat daya tahan mesin 3x lebih awet, 3x lebih kuat dan 3x lebih ringan.</p><p>Naked bike 150cc ini menawarkan Good Stability bagi pengendaranya. Menggunakan rangka Deltabox yang sudah teruji, All New Vixion menawarkan kesempurnaan bermanuver. Ditambah dengan suspensi monocross semakin menunjang kestabilan dalam berkendara. Untuk pengereman, motor ini menjanjikan pengereman yang optimal karena dilengkapi cakram pada roda depan dan belakang.</p>', 20.00, '150 CC', 'BANDUNG MAJALAYA', '<p>YAMAHA ALL NEW VIXION 155 2017</p>', '2025-09-10 22:27:02', '2025-11-06 15:16:38', NULL),
(6, 40, 6, 1, 1, 23, 29000, 'MH1KF0116NK103735', 'KF01E1104385', 'D 2052 ADU', 'S-04812932', 16800000.00, 20900000.00, 'available', '<p>meluncurkan All New Honda Vario 160 dengan perubahan menyeluruh pada mesin, rangka, desain dan fitur yang semakin canggih. Motor produksi anak bangsa ini hadir di Tanah Air sebagai jawaban bagi pecinta motor skutik premium sporti berperforma tinggi yang memberikan kebanggaan dan menjadi cerminan gaya hidup pengendara yang menyenangi sensasi berkendara nyaman dengan teknologi tinggi.</p><p>All New Honda Vario 160 memberikan sebuah energi dan gaya baru dalam revolusi desain, teknologi dan fitur canggih yang disematkan sesuai gaya berkendara masa kini. Model skutik ini mengekspresikan premium sporti dengan tampilan desain layaknya matik besar yang mampu memberikan kebanggaan bagi pengendaranya. Berbekal mesin performa tinggi kapasitas 160cc 4 katup enhanced Smart Power Plus (eSP+), serta memiliki teknologi minim gesekan menjadikan skutik premium sporti ini memberikan keseimbangan antara performa yang optimal dan kesempurnaan puncak saat dikendarai harian.</p>', 20.00, '160 CC', 'BANDUNG MAJALAYA', '<p>HONDA VARIO 160 CBS 2022</p>', '2025-09-11 00:53:55', '2025-11-06 16:53:18', NULL),
(7, 8, 18, 4, 11, 24, 8000, 'MH1KD1111PK437685', 'KD11E1436762', 'D 2874 ZFM', 'U-00837256', 25800000.00, 29000000.00, 'sold', '<p>All New Honda CRF150L memiliki desain dan konsep mesin motor on-off sport yang siap dapat memberikan petualangan menyenangkan. Motor ini mampu menaklukan tantangan di segala kondisi medan sehingga memberikan kebebasan pengendaranya untuk menikmati segala petualangan.</p><p>Dengan mengusung konsep terbaru yaitu Take You to Off Fun Ride All New Honda CRF150L hadir melalui penyematan desain terbaru, fitur unggulan baru dan mesin baru yang nyaman digunakan untuk berkendara di jalan raya dan menaklukan berbagai rintangan. Ketangguhan All New Honda CRF150L dicapai berkat penyematan mesin 150cc SOHC PGM-FI berperforma tinggi yang mendukung kemampuan jelajah optimal dengan nyaman dan mudah dikendalikan di berbagai kondisi jalan.</p>', 20.00, '150 CC', 'BANDUNG MAJALAYA', '<p>HONDA CRF 150 L 2023</p>', '2025-09-11 18:29:15', '2025-11-06 16:06:48', NULL),
(8, 10, 21, 2, 2, 19, 5800, 'MH4EX250SJJP01890', 'EX250PEA06122', 'D 3829 UEC', 'P-07873677', 33000000.00, 42500000.00, 'available', '<p>Pada Indonesian Motorcycle Show (IMOS) 2018, Kawasaki memperkenalkan Ninja 250 Model Year (MY) 2019. Sepeda motor sport 250cc berfairing ini mendapat fitur baru, yaitu Smart Key. Kunci pintar berbentuk key FOB miliknya ini dilengkapi dengan fitur Kawasaki Intelligent Proximity Activation Start System (KIPASS). Fitur ini memungkinkan pengendara menghidupkan dan memadamkan mesin kendaraan dengan lebih mudah.</p>', 20.00, '250 cc', 'BANDUNG MAJALAYA', '<p>KAWASAKI NEW NINJA 250 FI</p>', '2025-09-11 18:57:28', '2025-11-06 17:47:40', NULL),
(9, 9, 25, 2, 12, 22, 1800, 'MH3RG4710MK149338', 'G3J6E0306950', 'Z 3580 DAV', 'R00771932', 18500000.00, 23500000.00, 'available', '<p>Yamaha R15 VVA merupakan produk teranyar dari Yamaha untuk kelas motor sport fairing 150 cc. Pertama muncul sejak 2017 silam, satu diantara line up keluarga R series ini mengalami penyegaran dengan memunculkan warna terbaru. Penyegaran yang dilakukan selaras dengan perkembangan produk sport saat ini.</p><p>Tiga warna baru yang terdiri dari Metallic Blue, Matte Silver, dan Matte Black, disuguhkan sebagai bagian dari inovasi yang kian memperkuat karakter R15. Metallic Blue dengan velg berwarna biru mewakili kebanggaan menunjukkan identitas warna biru Yamaha. Ini pun merepresentasikan kecintaan akan pabrikan Yamaha yang tak berhenti menghadirkan produk sport terbaik kepada pelanggannya.</p><p>Menciptakan tren roda dua di Indonesia, Yamaha menghadirkan warna Matte Silver yang dipadu dengan velg berwarna kuning membuat penampilan semakin menarik. Kamu juga bisa memilih tampilan yang sporty namun tetap elegan, Matte Black dikombinasikan dengan suspensi depan upside down warna emas menjadi pilihan tepat agar makin percaya diri.</p>', 20.00, '155 CC', 'BANDUNG MAJALAYA', '<p>YAMAHA ALL NEW R15 155 VVA 2021</p>', '2025-09-11 19:18:59', '2025-11-06 10:48:27', NULL),
(10, 12, 21, 2, 3, 23, 12000, 'MH4EX250SNJP07047', 'EX250PEA28622', 'D 3601 VFC', 'S00599840', 39100000.00, 47500000.00, 'available', '<p>Kawasaki dengan bangga memperkenalkan sebuah model sport di arena yang sangat kompetitif, yaitu kelas sport 250 cc. Dibentuk dengan gaya Ninja baru yang tajam, Ninja 250 baru memberikan performa lebih hebat dibanding pendahulunya dengan mesin baru yang lebih bertenaga, dan juga dengan bobot yang lebih ringan.</p>', 20.00, '250 CC', 'BANDUNG MAJALAYA', '<p>KAWASAKI ALL NEW NINJA 250 FI 2022</p>', '2025-09-11 19:29:28', '2025-11-03 04:00:03', NULL),
(11, 16, 28, 1, 13, 25, 1000, 'MH3SG6410RJ433191', 'G3P2E0507197', 'D 5662 UFJ', 'V01954037', 23500000.00, 26750000.00, 'available', '<p>Yamaha All New Aerox Cyber City dibangun dengan desain futuristik dengan konsep teknologi canggih dan kenyamanan dalam setiap inci. Dirancang khusus untuk menghadapi tantangan lalu lintas perkotaan, Aerox Cyber City adalah rekan setia untuk menjelajahi kota dengan gaya dan keyakinan.</p>', 20.00, '155 CC', 'BANDUNG MAJALAYA', '<p>YAMAHA NEW AEROX CIBERCITY 2024</p>', '2025-09-11 19:56:23', '2025-11-03 03:56:13', NULL),
(12, 14, 25, 2, 9, 16, 40000, 'MH32PK001FK055927', '2PK055947', 'D 4335 VCZ', 'S06126222', 9500000.00, 11500000.00, 'available', '<p>YAMAHA R15 V2 2015</p>', 20.00, '150 CC', 'BANDUNG MAJALAYA', '<p>YAMAHA R15 2015</p>', '2025-09-11 20:20:10', '2025-11-05 10:52:18', NULL),
